import React, { useEffect, useState } from 'react';
import { Container, Typography, Box, Grid, Card, CardMedia, CardContent, Button, Rating } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import './Home.css';

const Home = () => {
  const navigate = useNavigate();
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch('http://localhost:5000/api/cars')
      .then((res) => res.json())
      .then((data) => {
        setCars(data);
        setLoading(false);
      })
      .catch((err) => {
        console.error('Error fetching cars:', err);
        setLoading(false);
      });
  }, []);

  if (loading) return <div>Loading...</div>;

  return (
    <Box>
      {/* Hero Section */}
      <Box className="home-hero">
        <Container maxWidth="xl">
          <Grid container spacing={4} alignItems="center">
            <Grid item xs={12} md={6}>
              <Typography variant="h2" component="h1" gutterBottom>
                Your Trusted & Hassle Free Car Buying Partner
              </Typography>
              <Typography variant="h6" paragraph>
                Get the best deals without the hassle of dealerships. Personalized service, better delivery, and affordable financing.
              </Typography>
              <Button
                variant="contained"
                size="large"
                sx={{
                  backgroundColor: 'white',
                  color: 'primary.main',
                  '&:hover': { backgroundColor: 'grey.100' },
                  mr: 2,
                }}
                onClick={() => navigate('/car/1')}
              >
                Find Your Car
              </Button>
              <Button
                variant="outlined"
                size="large"
                sx={{
                  borderColor: 'white',
                  color: 'white',
                  '&:hover': { borderColor: 'white', backgroundColor: 'rgba(255,255,255,0.1)' },
                }}
                onClick={() => navigate('/signup')}
              >
                Get Started
              </Button>
            </Grid>
            <Grid item xs={12} md={6}>
              <img
                src="https://images.unsplash.com/photo-1617531653332-bd46c24f2068"
                alt="Luxury Car"
                style={{ width: '100%', maxHeight: '400px', objectFit: 'cover', borderRadius: '10px' }}
              />
            </Grid>
          </Grid>
        </Container>
      </Box>

      {/* Featured Cars Section */}
      <Container maxWidth="xl">
        <Typography variant="h4" component="h2" gutterBottom>
          Featured Cars
        </Typography>
        <Grid container spacing={4}>
          {cars.map((car) => (
            <Grid item key={car._id} xs={12} sm={6} md={4}>
              <Card
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  '&:hover': { transform: 'scale(1.02)', transition: 'transform 0.2s' },
                  cursor: 'pointer',
                }}
                onClick={() => navigate(`/car/${car._id}`)}
              >
                <CardMedia
                  component="img"
                  height="200"
                  image={`http://localhost:5000${car.images && car.images.length > 0 ? car.images[0] : ''}`}
                  alt={car.title}
                />
                <CardContent>
                  <Typography gutterBottom variant="h6" component="h3">
                    {car.name}
                  </Typography>
                  <Typography variant="h5" color="primary.main" gutterBottom>
                    {car.price}
                  </Typography>
                  <Rating value={car.rating} precision={0.5} readOnly />
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>

        {/* Why Choose Us Section */}
        <Box sx={{ my: 8 }}>
          <Typography variant="h4" component="h2" gutterBottom textAlign="center">
            Why Choose Car Prime
          </Typography>
          <Grid container spacing={4} sx={{ mt: 2 }}>
            <Grid item xs={12} md={4}>
              <Box textAlign="center">
                <Typography variant="h6" gutterBottom>
                  Expert Guidance
                </Typography>
                <Typography color="text.secondary">
                  Our team of experts will help you find the perfect car that matches your needs and budget.
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={12} md={4}>
              <Box textAlign="center">
                <Typography variant="h6" gutterBottom>
                  Best Deals
                </Typography>
                <Typography color="text.secondary">
                  Get access to exclusive deals and competitive pricing on our wide selection of vehicles.
                </Typography>
              </Box>
            </Grid>
            <Grid item xs={12} md={4}>
              <Box textAlign="center">
                <Typography variant="h6" gutterBottom>
                  Easy Financing
                </Typography>
                <Typography color="text.secondary">
                  Quick and hassle-free financing options tailored to your requirements.
                </Typography>
              </Box>
            </Grid>
          </Grid>
        </Box>
      </Container>
    </Box>
  );
};

export default Home;
